// DeleteUniqueIndexCache 删除索引存在的缓存
func (d *DeviceRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.Device) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, d.cache.Key(CacheDeviceByConditionPrefix))
	keys = append(keys, d.cache.Key(CacheDeviceUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[d.cache.Key(CacheDeviceByIDPrefix, item.ID)] = struct{}{}
			KeyMap[d.cache.Key(CacheDeviceUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[d.cache.Key(CacheDeviceBySnPrefix, item.Sn)] = struct{}{}
			KeyMap[d.cache.Key(CacheDeviceUnscopedBySnPrefix, item.Sn)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := d.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
